/* To design a training database for a grocery warehouse, we can create the following tables: `Suppliers`, `Customers`, `Products`, `Warehouse`, `Stores`, and `Movement`.

Heres an example of how the tables could be structured: */

/* 1. `Suppliers` table: */

CREATE TABLE Suppliers (
  supplier_id INT PRIMARY KEY,
  supplier_name VARCHAR(100),
  supplier_address VARCHAR(100),
  supplier_phone VARCHAR(20)
);


/* 2. Customers table: */

CREATE TABLE Customers (
  customer_id INT PRIMARY KEY,
  customer_name VARCHAR(100),
  customer_address VARCHAR(100),
  customer_phone VARCHAR(20)
);


/* 3. `Products` table: */

CREATE TABLE Products (
  product_id INT PRIMARY KEY,
  product_name VARCHAR(100),
  supplier_id INT,
  FOREIGN KEY (supplier_id) REFERENCES Suppliers(supplier_id),
  expiry_date DATE
);


/* 4. `Warehouse` table: */

CREATE TABLE Warehouse (
  product_id INT,
  quantity INT,
  FOREIGN KEY (product_id) REFERENCES Products(product_id)
);


/* 5. `Stores` table: */

CREATE TABLE Stores (
  store_id INT PRIMARY KEY,
  store_name VARCHAR(100),
  store_address VARCHAR(100),
  store_phone VARCHAR(20)
);


/* 6. `Movement` table: */

CREATE TABLE Movement (
  movement_id INT PRIMARY KEY,
  product_id INT,
  store_id INT,
  quantity INT,
  movement_date DATE,
  FOREIGN KEY (product_id) REFERENCES Products(product_id),
  FOREIGN KEY (store_id) REFERENCES Stores(store_id)
);


/* Now, let's populate the tables with some example data: */


INSERT INTO Suppliers (supplier_id, supplier_name, supplier_address, supplier_phone)
VALUES
  (1, 'Supplier A', '123 Supplier Street, CityA', '123-456-7890'),
  (2, 'Supplier B', '456 Supplier Street, CityB', '987-654-3210');

INSERT INTO Customers (customer_id, customer_name, customer_address, customer_phone)
VALUES
  (1, 'Customer A', '123 Customer Street, CityA', '111-222-3333'),
  (2, 'Customer B', '456 Customer Street, CityB', '444-555-6666');

INSERT INTO Products (product_id, product_name, supplier_id, expiry_date)
VALUES
  (1, 'Jubilee cookies', 1, '2023-12-31'),
  (2, 'Inspiration coffee', 2, '2024-06-30');

INSERT INTO Warehouse (product_id, quantity)
VALUES
  (1, 100),
  (2, 50);

INSERT INTO Stores (store_id, store_name, store_address, store_phone)
VALUES
  (1, 'Store X', '123 Store Street, CityA', '777-888-9999'),
  (2, 'Store Y', '456 Store Street, CityB', '000-111-2222');

INSERT INTO Movement (movement_id, product_id, store_id, quantity, movement_date)
VALUES
  (1, 1, 1, 50, '2023-06-01'),
  (2, 1, 2, 25, '2023-06-15'),
  (3, 2, 2, 10, '2023-06-20');


/* Now, let's run the requested queries: */

/* 1. Determine the total amount of surplus and shortage in the grocery warehouse. */

SELECT SUM(quantity) AS total_surplus_shortage
FROM Warehouse;


/* 2. Find the name of the goods "Jubilee cookies" and the address of the company that supplied the goods. */

SELECT P.product_name, S.supplier_address
FROM Products P
JOIN Suppliers S ON P.supplier_id = S.supplier_id
WHERE P.product_name = 'Jubilee cookies';


/* 3. Remove the entry for the commodity "Inspiration" coffee. */

DELETE FROM Products
WHERE product_name = 'Inspiration coffee';

/* 4. Create a query that contains information about companies that raised the price of a product by more than $50 in the last year. */

-- Assuming there's a price column in the Products table
SELECT S.supplier_name, P.product_name
FROM Products P
JOIN Suppliers S ON P.supplier_id = S.supplier_id
WHERE P.price - (SELECT price FROM Products WHERE product_id = P.product_id AND YEAR(expiry_date) = YEAR(CURRENT_DATE()) - 1) > 50;

/* 5. Determine a list of items that expire in December 2005. */

SELECT product_name
FROM Products
WHERE YEAR(expiry_date) = 2005 AND MONTH(expiry_date) = 12;


/* 6. Create an entry for a new store. */

